create table "dim-atencion-sexo"
(
    id_transaction_servicio bigint,
    id_usuario              varchar(40),
    fecha_solicitud         timestamp,
    fecha_atencion          timestamp,
    tipo_servicio           text,
    id_medico               varchar(40),
    numero_identificacion   varchar(40),
    sexo                    varchar(2),
    edad                    integer,
    departamento            varchar(400)
);

alter table "dim-atencion-sexo"
    owner to postgres;

